import styles from './Todo.module.css'
import { RiTodoFill } from 'react-icons/ri'

function Todo({ todo, deleteTodo, index }) {
  return (
    <div
      className={styles.todo}
      onDoubleClick={(event) => {
        deleteTodo(index)
      }}
    >
      <RiTodoFill className={styles.todoIcon} />
      <h3>{todo.text}</h3>
    </div>
  )
}

export default Todo
